import RepaymentMatrix from '@/components/product/RepaymentMatrix.vue';
import BaseInfo from '@/components/common/BaseInfo.vue';
import ItemBox from '@/components/layout/ItemBox.vue';
import { BasePath } from '@/utils/config.js';
export default {
  data: function data() {
    return {
      stepTable: [],
      tableHeight: 'auto'
    };
  },
  created: function created() {// this.initLayered();
    // this.loadDealStructure();
  },
  components: {
    BaseInfo: BaseInfo,
    ItemBox: ItemBox,
    RepaymentMatrix: RepaymentMatrix
  },
  computed: {
    productDetail: function productDetail() {
      var productDetail = JSON.parse(JSON.stringify(this.$store.state.productInfo.productDetail));
      Object.keys(productDetail).forEach(function (key) {
        if ((productDetail[key] == '' || !productDetail[key]) && productDetail[key] != 0) {
          productDetail[key] = '-';
        }
      });
      return productDetail;
    },
    TrustID: function TrustID() {
      return this.$store.state.productInfo.trustId;
    }
  },
  methods: {
    stateFormat: function stateFormat(row, column, cellValue) {
      if (cellValue == null) {
        return '';
      } else {
        cellValue = Number(cellValue).toFixed(2);
        cellValue += "";
        if (!cellValue.includes(".")) cellValue += ".";
        return cellValue.replace(/(\d)(?=(\d{3})+\.)/g, function ($0, $1) {
          return $1 + ",";
        }).replace(/\.$/, "");
      }
    },
    stateFormatW: function stateFormatW(row, column, cellValue) {
      if (cellValue == null) {
        return '';
      } else {
        cellValue = (Number(cellValue) / 10000).toFixed(2);
        cellValue += "";
        if (!cellValue.includes(".")) cellValue += ".";
        return cellValue.replace(/(\d)(?=(\d{3})+\.)/g, function ($0, $1) {
          return $1 + ",";
        }).replace(/\.$/, "");
      }
    }
  },
  watch: {}
};
